import './App.css';
import Banner from './components/banner/Banner';
import Navbar from './components/Navbar';
import RowPost from './components/rowPost/RowPost';


function App() {
  return (
    <div className="App">
      <Navbar/>
      <Banner/>
      <RowPost title='Netflix Originals'/>
      <RowPost title='Action' isSmall/>
    </div>
  );
}

export default App;
